import React, { Component } from 'react'
import Navbar from '../component/navbar'
import './Profile.css'
import {connect} from 'react-redux'

class Profile extends Component {
  state = {
    name: this.props.valFromStore.U_name,
    pass : "",
    showName: "That is name",
    email: "Fuck@gmail.component",
    status: [],
    temp_name : ""
  }

   textboxHandleChange(e){
     console.log(e);
      this.setState({temp_name:e.target.value});
    }
  render() {
    const Editer = this.props.editeUser;

    return (
      <div className="Profile">
        <Navbar />
        <div className="container text-center">
          <h1 className="text-primary">Profile</h1>
          <p>Image</p>
          <p className="display-4" style={{ fontSize: "2.5rem" }}>{this.props.valFromStore.U_name}</p>
          <hr />

          <form style={{ width: "50%", margin: "auto" }}>
            <div className="form-group">
              <label className="label-name float-left" >Name    :</label>
              <input className="form-control" id="U_name" type="text" value="ei" onChange={this.textboxHandleChange.bind(this)} />
            </div>

            {
              (true)?<div className="form-group">
                <label className="label-status float-left" >Password  :</label>
                <input className="form-control" type="text" defaultValue={this.state.status} />
              </div>:<div></div>
            }
            <div className="form-group">
              <label className="label-email float-left">Email   :</label>
              <input className="form-control" id="U_email" type="text" defaultValue={this.state.email} />
            </div>
            <div className="form-group">
              <label className="label-status float-left" >Status  :</label>
              <input className="form-control" type="text" defaultValue={this.state.status} />
            </div>
          </form>
          
          <button onClick={Editer.bind(this,{...this.state,name:"staner"})}>  Change</button>
        </div>
      </div>
    )
  }

}


const mapStateToProps = state =>{
  return{
    valFromStore : state.user
  }
}

const mapDispatchToProps = dispatch => {
  return {
    editeUser:(val)=>{
      return dispatch({type:'edite_user',payload:{ user:{U_name:this.state.temp_name} }});
    }
  }
}

export default connect(mapStateToProps,mapDispatchToProps)(Profile);
